import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';

const EditAdminData = () => {
    const { adminId } = useParams();
    const navigate = useNavigate();
    const [admin, setAdmin] = useState({
        name: '',
        phoneNumber: '',
        emailId: '',
        password: '',
    });

    // Fetch admin data by ID
    useEffect(() => {
        const fetchAdmin = async () => {
            try {
                const response = await fetch(`http://10.10.20.9:7071/IIA-Website-1.0.0/admin/getbyid/${adminId}`);
                const data = await response.json();
                setAdmin(data); // Set the admin data to the state
            } catch (error) {
                console.error('Error fetching admin data:', error);
            }
        };

        fetchAdmin();
    }, [adminId]);

    // Handle input change to update the admin state
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setAdmin((prevAdmin) => ({
            ...prevAdmin,
            [name]: value,
        }));
    };

    // Handle form submit to update admin data
    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch(`http://10.10.20.9:7071/IIA-Website-1.0.0/admin/editadmin/${adminId}`, {
                method: 'PUT',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(admin), // Send the updated admin data
            });

            if (response.ok) {
                navigate('/total-students'); // Redirect back to the list after successful update
                alert("data updated sucessfully")
            } else {
                console.error('Failed to update admin');
            }
        } catch (error) {
            console.error('Error updating admin:', error);
        }
    };

